function xqLoading(n){let a=document.createElement("div");a.className="loading";let e='<div class="loading-inner"><span class="loading-circle"></span><i class="fa fa-'+n+'"></i></div>';a.innerHTML=e,document.body.appendChild(a)}window.onload=function(){document.querySelector(".loading").className="loading active"};